import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const linkTitles = linkTitle.map((number) =>
    <li className='nav-link' key={number + number} href={number[0]}>
        {number[1]}
    </li>
  );

  return (
    <div className="navbar">
        <ul className="nav">
          {linkTitles}
        </ul>
      </div>
  );
}

export default Nav;
